" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 560px\">",
"   <div class=\"ttl\">",
"    Normal elbow, lateral view",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 540px; height: 623px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note the normal small anterior fat pad (black arrow), and the normal alignment. The radiocapitellar line (white line) extends from the midshaft of the proximal radius and bisects the capitellum. Dislocation or displaced fracture of the radial head or capitellum will disrupt this alignment. The anterior humoral line (black line) extends along the anterior of the humerus and should cross the middle of the capitellum. A supracondylar fracture can disrupt this alignment.",
