var title_f40_61_41944="Blood in fetal stomach";
var content_f40_61_41944=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F67005%7EOBGYN%2F57271&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F67005%7EOBGYN%2F57271&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 532px\">",
"   <div class=\"ttl\">",
"    Intraamniotic bleeding and gastric pseudomass in fetus at 21 weeks' gestational age, 2 weeks after transplacental amniocentesis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 512px; height: 226px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) Transverse transabdominal sonogram shows echogenic particles floating in amniotic fluid (arrow) that were not present before amniocentesis. Until third trimester, echogenic particles in amniotic fluid should raise possibility of bleeding. Later in pregnancy, particles are most commonly the result of shed epithelial cells (vernix caseosa). (B) Transverse sonogram of fetal abdomen shows echogenic material (arrow) in stomach that results from fetus swallowing echogenic blood particles that resulted from recent amniocentesis. Gastric pseudomasses resolve on follow-up examination. To our knowledge, no gastric neoplasms have been reported on prenatal sonography.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Trop I, Levine D. Hemorrage During Pregnancy: Sonography and MR Imaging. AJR Am J.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Echogenic fetal bowel at 15 weeks' gestational age in 33-year-old woman with vaginal bleeding",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 367px; height: 310px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sonogram revealed subchorionic hemorrhage (not shown). Sagittal scan through fetal abdomen reveals hyperechoic loops of bowel (arrow) as echogenic as adjacent bone. Cytomegalovirus titers and karyotype were normal, and findings of prenatal screening for cystic fibrosis were negative. Normal bowel echotexture was seen on follow-up 2 weeks later (not shown).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Trop I, Levine D. Hemorrage During Pregnancy: Sonography and MR Imaging. AJR Am J Roentgenol 2001; 176:607.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
