var title_f40_61_41949="Survival alcoholic cardiomyop";
var content_f40_61_41949=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F79337&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F79337&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    Outcome is poor in patients with alcoholic cardiomyopathy who continue to drink",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 344px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Survival curves of cardiac deaths show no difference in survival between patients with an idiopathic dilated cardiomyopathy and those with an alcoholic cardiomyopathy who abstain from further drinking. However, survival is significantly lower in those with an alcoholic cardiomyopathy who continue to drink (p = 0.002).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Fauchier L, Babuty D, Poret P, et al, Eur Heart J 2000; 21:306.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
