var title_f40_61_41950="Metoprolol hospitaliz HF";
var content_f40_61_41950=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F60489&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F60489&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Metoprolol reduces the number of heart failure patients requiring hospitalization",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 394px; height: 555px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the MERIT-HF trial of 3991 patients, metoprolol CR/XL reduced the number of patients requiring hospitalization for any reason by 18 percent compared to placebo (p = 0.004), the number admitted for a cardiovascular cause by 25 percent (p &lt;0.001), and the number admitted for worsening heart failure by 35 percent (p &lt;0.001) (Panel A). There was an equivalent reduction in the number of hospital days (Panel B).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Hjalmarson A, Goldstein S, Fagerberg B, et al. JAMA 2000; 283:1245.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
